import React from 'react';  
import Head from 'next/head'
import Link from 'next/link'
import Layout from './layout'
import Clock from 'react-live-clock';
import { Navbar, Nav, NavItem, MenuItem, NavDropdown } from '../node_modules/react-bootstrap';
class Top extends React.Component { 
    render() 
    { 
        return  <Layout><div className="top-body container-fluid">
        <Nav className="justify-content-end nav" justify="true">   
        <Link href="/">
        <a className="name-color">CodeStats</a>
        </Link>
            <h2><Clock format={'HH:mm:ss'} ticking={true} timezone={'India Standard Time'} /></h2>
            
        </Nav>
        </div>
        </Layout>;
    } 
}  
export default Top;
